import React from 'react';
import '../styles.css';

function Main() {
  return (
    <div className="main">
      <section>
        <h2>Bienvenido a la Gestión de Prácticas en Empresas</h2>
        <p>¡Aquí podrás gestionar los alumnos, empresas, candidatos y más!</p>
      </section>
      <div className="extra-div"></div>
    </div>
  );
}

export default Main;
